import React from 'react';
import { IconBaseProps } from 'react-icons';
import { FaUser } from 'react-icons/fa';
import { RiFileList2Fill, RiFileList3Line } from 'react-icons/ri';
import { Container, Content, MenuItem } from './styles';

type FloatMenuProps = Array<{
  icon: React.ComponentType<IconBaseProps>;
  name: string;
  url: string | undefined;
}>;

const FloatMenu: React.FC<FloatMenuProps> = menus => {
  return (
    <Container>
      <Content>
        {menus.map(({}) => (
          <MenuItem>
            <Icon size={35} />
            <label>Listar</label>
          </MenuItem>
        ))}
      </Content>
    </Container>
  );
};
export default FloatMenu;
